    <script>  
        document.addEventListener('DOMContentLoaded', function() {  
            const BASE = 0x4E00;  
            const encodedElement = document.getElementById('encoded-data');  
            // Get the encoded text  
            const encodedText = encodedElement.textContent;  

            let decodedHtml = '';  

            // Decode the text character by character  
            for (let i = 0; i < encodedText.length; i++) {  
                const ch = encodedText[i];  
                const charCode = ch.codePointAt(0);  
                const byteValue = charCode - BASE;  

                if (byteValue < 0 || byteValue > 255) {  
                    console.error('Invalid character detected. Decoding aborted.');  
                    document.body.innerHTML = '<h1>Decoding Error!</h1>';  
                    return;  
                }  

                // Convert the byte value to the original character  
                // Note: This assumes the original file was text (like HTML, CSS, JS)  
                // and was originally encoded with UTF-8, which is common.  
                decodedHtml += String.fromCharCode(byteValue);  
            }  

            // Clear the current document and write the decoded HTML/content.  
            // This makes the browser execute the content as if it were the original file.  
            document.open();  
            document.write(decodedHtml);  
            document.close();  

            // Optional: For non-HTML content, you might just display it.  
            // document.body.textContent = decodedHtml;  
        });  
    </script>
